      //       <div className={styles.mediaFlexContainder}>
      //         <div className={styles.mediaRaiting}></div>
      //         <div className={styles.mediaTitleName}>
      //           {title.titleBase.name}
      //         </div>
      //         <hr />
      //       </div>
      //     </div>
      //   </div>
      // </div>
    )
  }
}

export default Title
